contracts/voting3.sol.content:
// SPDX-License-Identifier: MIT

pragma solidity ^0.8.0;

contract Voting {
    struct Candidate {
        uint256 id;
        string name;
        uint256 voteCount;
    }

    mapping(uint256 => Candidate) public candidates;
    mapping(address => bool) public hasVoted;
    uint256 public totalVotes;
    uint256 public candidateCount;

    event VoteCasted(uint256 indexed candidateId, address indexed voter);

    constructor(string[] memory _candidateNames) {
        require(_candidateNames.length > 0, "At least one candidate is required");

        for (uint256 i = 0; i < _candidateNames.length; i++) {
            candidateCount++;
            candidates[candidateCount] = Candidate(candidateCount, _candidateNames[i], 0);
        }
    }

    function vote(uint256 _candidateId) public {
        require(_candidateId > 0 && _candidateId <= candidateCount, "Invalid candidate ID");
        require(!hasVoted[msg.sender], "Already voted");

        Candidate storage candidate = candidates[_candidateId];
        candidate.voteCount++;
        totalVotes++;
        hasVoted[msg.sender] = true;

        emit VoteCasted(_candidateId, msg.sender);
    }

    function getCandidate(uint256 _candidateId) public view returns (uint256, string memory, uint256) {
        require(_candidateId > 0 && _candidateId <= candidateCount, "Invalid candidate ID");

        Candidate memory candidate = candidates[_candidateId];
        return (candidate.id, candidate.name, candidate.voteCount);
    }
}

